import React from 'react';
import LogoFlylist from '../../assets/svg/logo-flylist.svg'
import LogoTchat from '../../assets/svg/logo-tchat.svg'
import LogoAeroaja from '../../assets/svg/logo-aeroaja.svg'
import LogoAsita from '../../assets/svg/logo-asitaaja.svg'

export default class NewsEvent extends React.Component {
  render() {
    return(
      <div className="bg-secondary">
        <div className="white f25">Our Product</div>
        <div className="row">
          <div><img src={LogoFlylist} alt="logoflylist" className="box-img bg-header"/></div>
          <div><img src={LogoTchat} alt="logotchat" className="box-img bg-header"/></div>
          <div><img src={LogoAeroaja} alt="logoaeroaja" className="box-img bg-header"/></div>
          <div><img src={LogoAsita} alt="logoasitaaja" className="box-img bg-header"/></div>
        </div>
      </div>
    )
  }
}
